import React from 'react';
import PropTypes from 'prop-types';

const AllergyItem = ({
  allergy: {
    vaccineName,
    note,
  }
}) => {
  return (
    <div style="color:blue">
        <p>
          {note}
        </p>
    </div>
  );
};

AllergyItem.propTypes = {
  allergy: PropTypes.object.isRequired
};

export default AllergyItem;
